import logo from './logo.svg';
import './App.css';

const Hello = (props) => {
  return(
      <div>
        <p>oh hey! {props.name}</p>
      </div>
  )
}

function App() {
  const now = new Date()
  const a = 10
  const b = 2
  console.log("hello! I'm from the component")
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>
          <Hello name="Jim"> </Hello>
          <Hello name="Mark"> </Hello>
        </h1>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <p>
          Hello pretty Momma! it is {now.toString()}
        </p>
        <p>
          GENERAL KENOBI
        </p>
        <p>
          Lets do some math! {a} plus {b} is {a+b}
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
